import FooterApp from "./AppHTML/FooterApp";

import React, { useState, useEffect } from "react";
import { HashRouter, Routes, Route } from "react-router-dom";


function App() {

  useEffect(() => {
    fetch("/api/小提琴")
    .then((res) => res.json())
    .then((data) => console.log(data))
  }, [])

  return (
    <div className="gridContainer">
      <HeaderApp />

      <HashRouter>
        <NavApp />
        <MainApp/>
      </HashRouter>

      <FooterApp />
    </div>




  );
}

export default App;
